import React, { useEffect, useState } from "react";
const App = () => {
  const [backendData, setBackendData] = useState({
    description: "",
    generator: "",
    items: [{}],
    link: "",
    modified: "",
    title: ""
  });
  useEffect(backendData => {
    const fetchData = async () => {
      const result = await fetch("/api");
      console.log(result);
      const data = await result.json();
      console.log(data);
      setBackendData(data);
      console.log(backendData);
    };
    fetchData();
  }, []);
  return (
    // console.log(backendData.items.map(b => b.author_id)),
    <div>
      {backendData.items.map(b => (
        <div key={b.author_id}>{b.author_id}</div>
      ))}
      <div>none</div>
      <div></div>
    </div>
  );
};

export default App;
